import { makeStyles } from "@material-ui/styles";

export default makeStyles((theme) => ({
  root: {
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    height: "100vh",
  },


  bottomContentWrapper: {
    textAlign: "center",
    "&>a": {
      marginLeft: 40,
    },
  },

  buttonWrapperLogin: {
    margin: "",
    display: "flex",
    alignItems: "center",
    justifyContent: "space-between",
  },
  buttonWrapper: {
    margin: (4, 0),
    "& > button": {
      width: "100%",
    },
  },
  buttonWrapper2: {
    margin: 10,
    "& button": {
      width: "100%",
      marginBottom: 40,
    },
  },

  titleLogin: {
    marginBottom: 25,
    textAlign: "center",
    color: "white",
  },

  paper: {
    padding: 10,
    height: "100%",
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
  },
  image: {
    backgroundRepeat: "no-repeat",
    backgroundColor: "white",
    backgroundSize: "cover",
    backgroundPosition: "center",
  },
  content: {
    maxWidth: "400px",
    minWidth: "400px",
    backgroundColor: "#33936E",
  },

  wrapperTitle: {
    display: "flex",
    alignItems: "flex-start",
    marginBottom: 20,
  },
  wrapperContent: {
    paddingLeft: 8,
    "& p": {
      marginBottom: 6,
    },
  },
  titleName: {
    marginBottom: 16,
  },
}));
